import React, { useState, useEffect } from 'react';

export default function VehicleHistory(props) {
    const [searchedHistory, setSearchedHistory] = useState([])
    console.log(searchedHistory)
    useEffect(() => {
        const storeVehicle = [];
        storeVehicle.push(props.searched)
        setSearchedHistory(storeVehicle);
    }, [props.searched])

    if (Object.keys(props.searched).length !== 0) {
        return (
            <div>
                <div className="title-container">
                    <h3>History</h3>
                </div>
                <hr />
                <div className="searched__vehicle-container">
                    {searchedHistory.map((data) => {
                        return (
                            <p>{data.years[0].year}{vehicleInfo.make.name}{vehicleInfo.model.name}{vehicleInfo.engine.name}{vehicleInfo.categories.vehicleStyle}</p>
                        )
                    })}
                </div>
            </div>
        )
    }
}
